function specialPerm(nums: number[]): number {
    const mod = 1e9 + 7;
    const n = nums.length;
    nums.sort((a, b) => a - b);

    const gcd = (a: number, b: number): number => {
        while (b !== 0) [a, b] = [b, a % b];
        return a;
    };

    const dp = Array.from({ length: 1 << n }, () => 0);
    const count = Array.from({ length: n }, () => Array(n).fill(0));

    for (let i = 0; i < n; i++) {
        for (let j = 0; j < n; j++) {
            if (gcd(nums[i], nums[j]) === 1) {
                count[i][j] = 1;
            }
        }
    }

    dp[0] = 1;
    for (let mask = 1; mask < (1 << n); mask++) {
        for (let i = 0; i < n; i++) {
            if ((mask & (1 << i)) === 0) continue;
            const prevMask = mask ^ (1 << i);
            if (prevMask === 0) {
                dp[mask] = (dp[mask] + 1) % mod;
                continue;
            }
            for (let j = 0; j < n; j++) {
                if ((prevMask & (1 << j)) !== 0 && count[i][j] === 1) {
                    dp[mask] = (dp[mask] + dp[prevMask]) % mod;
                }
            }
        }
    }

    return dp[(1 << n) - 1];
}
